// src/pages/CitizenFormPage.js
import React from 'react';

function CitizenFormPage() {
  return (
    <div style={{ padding: '2rem' }}>
      <h2>Submit a Public Issue</h2>
      <form>
        <input placeholder="Issue Title" /><br /><br />
        <textarea placeholder="Describe the issue..." /><br /><br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default CitizenFormPage;
